import React, { useState } from "react";

function App() {
  const [likes, setLikes] = useState(0)

  const increment = () => {
    setLikes(likes++)
  }

  const decrement = () => {
    setLikes(likes++)
  }


  return (
    <div className="App"> 
      <h1>{likes}</h1>
      <button onClick={() => {
        console.log(likes);
      }}>Increment</button>
      <button onClick={() => likes--}>Decrement</button>
    </div>
  );
}

export default App;
